//CSS
import './App.css';
import './index.css';
import React from 'react';
import Row from 'react-bootstrap/Row';
// import Col from 'react-bootstrap/Col';

const NavBar = (props) => {

  return (
    <>
    <nav className="navbar">
      <ul className="navbar-nav">
      {props.children}
      </ul>
    </nav>
    </>
  )
}

const  Home = () => {
  return (
    <>
      <NavBar>
        <li>X</li>
      </NavBar>
      <Row>

        <h1>Admin Dashboard</h1>
      </Row>

    </>
  );
}

export default Home;
